import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const ResultScreen = () => {
  return (
    <View>
      <Text>ResultScreen</Text>
    </View>
  )
}

export default ResultScreen

const styles = StyleSheet.create({})
